import React from "react";
import { Link } from "react-router-dom";

import "./about.styles.css";

export const About = () => {
  const buttonPressed = () => {
    console.log("Button Pressed!");
  };
  return (
    <div className="about-main-container">
      <div className="about-container">
        <header className="about-header">About Our Company</header>
        <p className="about-text">
          Living Skies was born in 2015. Working out of a two car garage, taking
          by appointment bookings & working up to locking in dealership
          contracts.
        </p>
        <p>
          We quickly outgrew the garage and moved into a colaboration with Sign
          Universe in 2016 for the next year & half
        </p>
        <Link to="/contact">
          <button className="btn-about">Contact Us</button>
        </Link>
      </div>
    </div>
  );
};
